import React, { Component } from 'react';
import logo from '../assets/logo_byos_yellow.png';


export default class Home extends Component {


    componentDidMount() {

    }

    render() {

        return (
                <div class="container">
                <div class="row">
                    <div class="col-sm-offset-1 col-sm-12">
                    <h1>Home</h1>
                    </div>
                </div>
                <div class="row">
                    <div class="col-sm-offset-1 col-sm-12">
                    <img src={logo} alt='logo_byos' width="100%"></img>
                    </div>
                </div>
            </div>
        )
    }
}
